import logo from './logo.svg';
import './App.css';
import Item from './MyItem';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Item name="Teddy" /> 
        <Item name="Elliot" />
        <Item name="Ruba" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
